import Admin from "./pages/Admin"
import Auth from "./pages/Auth"
import EventPage from "./pages/EventPage"
import Events from "./pages/Events"
import { ADMIN_ROUTE, EVENTPAGE_ROUTE, EVENTS_ROUTE, LOGIN_ROUTE, REGISTRATION_ROUTE } from "./utils/consts"


export const authRoutes = [
  {
    path: ADMIN_ROUTE,
    Component: Admin
  },
]

export const publicRoutes = [
    {
      path: EVENTS_ROUTE,
      Component: Events
    },
    {
      path: REGISTRATION_ROUTE,
      Component: Auth
    },
    {
      path: LOGIN_ROUTE,
      Component: Auth
    },
    {
      path: EVENTPAGE_ROUTE + '/:id',
      Component: EventPage
    },
]
